U.K. Singh , Manish Dwivedi, &quot;Problems and Solutions in Mechanical Engineering&quot;
New Age International (P) Ltd., Publishers | 2008 | ISBN: 8122421008 | 530 pages | PDF | 2,6 MB

The present book is mainly meant for the students of first year - all branches of U.P. Technical University. This book is in the form of Questions and Answers. However, there is no need of any textbook from the concept point of view. This book gives you all the concepts step by step in the form of Theoretical Questions and then numericals based on theory. At the end of chapters, some tutorial sheets are given for practice. Lab manuals are also given at the end of book.
